No se si te haya ocurrido que vas al parque ya sea a correr, caminar, pasear al perro, etc y aprecias que hay mas gente con perros pero traen en la correa amarrado un liston amarillo, si no te has acercado a preguntar al dueño la razon, aqui te la presento...

<a href="http://lozanet.com/wp-content/uploads/2014/01/IMAG1358-770x330.jpg"><img class="alignleft size-full wp-image-338" alt="IMAG1358-770x330" src="http://lozanet.com/wp-content/uploads/2014/01/IMAG1358-770x330.jpg" width="770" height="330" /></a>

El liston o pañuelo amarillo sirven para indicar a las demas personas que el perro puede no ser amigable con las demas personas o que se sufre problemas de ansiedad al emocionarse demasiado pudiendo llegar a herir sin ser esa su intencion.

<a href="http://lozanet.com/wp-content/uploads/2014/01/yellow.jpg"><img class="alignleft size-full wp-image-337" alt="yellow" src="http://lozanet.com/wp-content/uploads/2014/01/yellow.jpg" width="600" height="365" /></a>

<span style="line-height: 1.5;">El Yellow Dog Project (Proyecto Perro Amarillo) es una organizacion sin fines de lucro que trata de concientizar a las personas a que utilicen este liston o pañuelo para indicar un posible riesgo y evitar algun accidente.</span>

<a href="http://lozanet.com/wp-content/uploads/2014/01/400x524xyellow-ribbon-dog-meaning.jpg.pagespeed.ic_.FPl8M_PheV.jpg"><img class="alignleft size-full wp-image-339" alt="400x524xyellow-ribbon-dog-meaning.jpg.pagespeed.ic_.FPl8M_PheV" src="http://lozanet.com/wp-content/uploads/2014/01/400x524xyellow-ribbon-dog-meaning.jpg.pagespeed.ic_.FPl8M_PheV.jpg" width="400" height="524" /></a>

